import React, { useState } from "react";

const daysOfWeek = ["Sunday", "Monday", "Tuesday", "Wednesday", "Thursday", "Friday", "Saturday"];

const categories = ["Category A", "Category B", "Category C"];

const CreateCompany = () => {
  const [logo, setLogo] = useState(null);
  const [name, setName] = useState("");
  const [address, setAddress] = useState("");
  const [contacts, setContacts] = useState("");
  const [email, setEmail] = useState("");
  const [website, setWebsite] = useState("");
  const [fax, setFax] = useState("");
  const [description, setDescription] = useState("");
  const [category, setCategory] = useState(categories[0]);
  const [images, setImages] = useState([]);
  const [openingHours, setOpeningHours] = useState({});
  const [closingHours, setClosingHours] = useState({});

  const handleLogoChange = (event) => {
    setLogo(event.target.files[0]);
  };

  const handleNameChange = (event) => {
    setName(event.target.value);
  };

  const handleAddressChange = (event) => {
    setAddress(event.target.value);
  };

  const handleContactsChange = (event) => {
    setContacts(event.target.value);
  };

  const handleEmailChange = (event) => {
    setEmail(event.target.value);
  };

  const handleWebsiteChange = (event) => {
    setWebsite(event.target.value);
  };

  const handleFaxChange = (event) => {
    setFax(event.target.value);
  };

  const handleDescriptionChange = (event) => {
    setDescription(event.target.value);
  };

  const handleCategoryChange = (event) => {
    setCategory(event.target.value);
  };

  const handleImagesChange = (event) => {
    setImages(event.target.files);
  };

  const handleOpeningHoursChange = (event) => {
    const { name, value } = event.target;
    setOpeningHours((prev) => ({ ...prev, [name]: value }));
  };

  const handleClosingHoursChange = (event) => {
    const { name, value } = event.target;
    setClosingHours((prev) => ({ ...prev, [name]: value }));
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // Submit form data to server
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>
        Company logo:
        <input type="file" accept="image/*" onChange={handleLogoChange} />
      </label>
      <br />
      <label>
        Company name:
        <input type="text" value={name} onChange={handleNameChange} />
      </label>
      <br />
      <label>
        Company address:
        <input type="text" value={address} onChange={handleAddressChange} />
      </label>
      <br />
      <label>
        Company contacts:
        <input type="text" value={contacts} onChange={handleContactsChange} />
      </label>
      <br />
      <label>
        Company email:
        <input type="email" value={email} onChange={handleEmailChange} />
      </label>
      <br />
      <label>
        Company website:
        <input type="text" value={website} onChange={handleWebsiteChange} />
      </label>
      <br />
      <label>
        Company fax:
        <input type="text" value={fax} onChange={handleFaxChange} />
      </label>
      <br />
      <label>
        Company description:
        <textarea value={description} onChange={handleDescriptionChange} />
      </label>
      <br />
      <label>
        Company category:
        <select value={category} onChange={handleCategoryChange}>
          {categories.map((category) => (
            <option key={category} value={category}>
              {category}
            </option>
          ))}
        </select>
      </label>
      <br />
      <label>
        Company/Stock images:
        <input type="file" accept="image/*" multiple onChange={handleImagesChange} />
      </label>
      <br />
      <h3>Opening hours</h3>
      <table>
        <thead>
          <tr>
            <th>Day</th>
            <th>Opening time</th>
            <th>Closing time</th>
          </tr>
        </thead>
        <tbody>
          {daysOfWeek.map((day) => (
            <tr key={day}>
              <td>{day}</td>
              <td>
                <input
                  type="time"
                  name={day}
                  value={openingHours[day] || ""}
                  onChange={handleOpeningHoursChange}
                />
              </td>
              <td>
                <input
                  type="time"
                  name={day}
                  value={closingHours[day] || ""}
                  onChange={handleClosingHoursChange}
                />
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <br />
      <button type="submit">Submit</button>
    </form>
  );
};

export default CreateCompany;
